import React, { useState ,useEffect} from 'react';
import { Link } from "react-router-dom";
import axios from 'axios';


import './assests/css/main.css';
import './assests/css/main.css.map';
import "./assests/js/main.js";
import './assests/scss/_layouts/_header.scss';
import './assests/scss/_layouts/_navigation.scss';
import './assests/scss/abstract/_font.scss';
import './assests/scss/abstract/_variables.scss';
import './assests/scss/components/_switch.scss';
import './assests/scss/forms/login.scss';
import './assests/scss/forms/reg.scss';
import './assests/scss/main.scss';

import img1 from './assests/images/search.png';
import img2 from './assests/images/tractor3_illus.png';



export default function Abc(){
      
  

//   var images =[
//     { id: 1, src: '../dp.jpg', title: 'foo', description: 'bar' },
//     { id: 2, src: 'require( "E:\\Ashok pers\\Pictures\\IMG_20191225_164546.jpg")', title: 'foo', description: 'bar' },
//     { id: 3, src: 'E:\\Ashok pers\\Pictures\\dp.jpg', title: 'foo', description: 'bar' },
//     { id: 4, src: 'E:\\Ashok pers\\Pictures\\dp.jpg', title: 'foo', description: 'bar' },
//     { id: 5, src: 'E:\\Ashok pers\\Pictures\\dp.jpg', title: 'foo', description: 'bar' },
    
//  ];

//Object.onload=function(){getdata};   

const [images,setImages]=useState({
  picname:[]
})

var cnt=0;

useEffect(()=>{
getdata();
 console.log('hii');
  
  }, [])


function dis(pics){
  return pics.map((id,picname)=>{
  <div>

    <h1>{id}</h1>
    <h1>{picname}</h1>
  </div>
  })
}

function getdata(){
  axios
  .post('/getpics',"hi pa")
      .then((res)=>{
        //console.log(res.data[8])
        setImages((preState)=>{
          return{
            ...preState,
           picname:res.data,
          };
        })
        //console.log(picname[9]);
       
      })
      .catch((err)=>{
      console.log(err)});
      }
    
const{picname}=images

console.log(picname[3]);

    return(
      
        <>

    <div className="header" >
    {/* <h1>{picname[9]}</h1> */}
      <nav className="navbar">
        <div className="logo">
          <a href="">LOGO</a>
        </div>
        <ul className="navbar--items">
          <li className="navbar--links">
            <a href="./index.html">Home</a>
          </li>
          <li className="navbar--links">
            <a href="#">About</a>
          </li>
          <li className="navbar--links">
            <a href="#">Contact</a>
          </li>
          <li className="navbar--links sign">
            <Link to="/login" className='btn1'>Sing In</Link>
          </li>
          <li className="navbar--links">
            <Link to="/Register">Sing Up</Link>
          </li>
        </ul>
        <div className="search">
          <input className="search--tbox" type="text" />
          <button className="search--btn">
            <img src= {img1} alt="" className='oneim' />
          </button>
        </div>
      </nav>
      <div className="intro" >
        <div className="intro--title" >
          <p>Book <br />Your Work <br />Easily!!</p>
          <p className="text-own">Sign In As OWNER Now!</p>
          <Link to="/login" className='bt'>Sing In</Link>
        </div>
        <img src={img2} alt="tractor img" />
      </div>
    <script src="./assests/js/main.js"></script>
    </div>
  <div >
    {/* <h1>hkxcdsji</h1>
    <img src={require( "E:\\Ashok pers\\Pictures\\IMG_20191225_164546.jpg")} alt='padam' width='500px'></img> */}
    { picname.map(({  profile ,id}) => <div className='gallery'>
      <img width="600" height="400" src={require( './images/'+profile)} /> 
      <div className='desc'><button className='bt' >Order Now</button></div>
      </div>)}
    
  </div>
 
        
        </>
    );
    
    }
